GameData["ui_ext"]["ui_info"]["help_text_list"]["text_05"] = [[$16022235]] -- - By accessing ancient tomes from the Librarium, he gains varied sets of powers.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_06"] = [[$16022236]] -- - Can utilise the Grey Knights Teleporter, for lightning-fast battlefield deployment.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_07"] = [[$16022237]] -- - Very effective against Daemons.
